Since the vertex is at $(p,p)$, we know that the parabola is symmetric around the line $x=p$.  This means that the $x$-coordinate of the other $x$-intercept must also be $p$.

Since the $y$-intercept is $(0,-p)$, we know that the parabola passes through the point $(0,-p)$.

We can use these facts to find $b$.

\begin{align*}
y &= ax^2 + bx + c \\
-p &= a(0)^2 + b(0) + c \\
-p &= c
\end{align*}

Now we know that $c=-p$.

Since the parabola is symmetric around $x=p$, the other $x$-intercept is also $p$. This means that the parabola passes through the point $(p,0)$.

\begin{align*}
y &= ax^2 + bx + c \\
0 &= a(p)^2 + b(p) - p \\
0 &= ap^2 + bp - p \\
p &= ap^2 + bp
\end{align*}

We can solve for $b$:

\begin{align*}
p &= ap^2 + bp \\
p - ap^2 &= bp \\
\frac{p - ap^2}{p} &= b \\
\boxed{b = 1 - ap}
\end{align*}

