\[\left( \frac{x + y}{2} \right)^2 = x^2 + y^2 - 2xy \cdot \frac{x}{y}.\]This simplifies to $x^2 + 2xy + y^2 = 4x^2 + 4y^2 - 4x^2 = 0,$ so $3x^2 + 3y^2 - 2xy = 0.$

Then $3x^2 - 2xy + 3y^2 = 0.$  We can write this as
\[(3x - y)(x - 3y) = 0.\]If $3x - y = 0,$ then $y = 3x.$  If $x - 3y = 0,$ then $x = 3y.$

Suppose $y = 3x.$  Then
\[\cos C = \frac{x}{3x} = \frac{1}{3}.\]Then $C = \cos^{-1} \frac{1}{3}.$

