B = (31,0);
C = intersectionpoint(arc(A,22,0,180),arc(B,sqrt(31^2+22^2)/2,0,180));
D = (C+B)/2;
EE = (A+C)/2;
draw(A--B--C--cycle);
draw(A--D);
draw(B--EE);
label("$A$",A,SW);
label("$B$",B,SE);
label("$C$",C,N);
label("$D$",D,S);
label("$E$",EE,W);
[/asy]

* **Using the Pythagorean Theorem:** Since $\overline{AD}$ and $\overline{BE}$ are perpendicular, we have two right triangles: $\triangle ABD$ and $\triangle BCE$.

* **Let's focus on triangle ABD:** We know $AC = 22$ and $D$ is the midpoint of $BC$, so $BD = BC/2 = 31/2$. We can use the Pythagorean Theorem to find $AB$:

 $$AB^2 = AD^2 + BD^2$$

* **We need to find AD:** Since $D$ is the midpoint of $BC$, we can use the Pythagorean Theorem on triangle $BDC$ to find $DC$:

$$DC^2 = BC^2 - BD^2 = 31^2 - (31/2)^2$$

* **Now we can find AD:**

$$AD^2 = AC^2 - DC^2 = 22^2 - (31^2 - (31/2)^2)$$

* **Finally, we can find AB:**

$$AB^2 = AD^2 + BD^2 = (22^2 - (31^2 - (31/2)^2)) + (31/2)^2$$

